import React from "react";
import "./homepage.css"; // Import styles

const GenreSection = () => {
  const genres = [
    { name: "Metro", image: "images/metro.png" },
    { name: "BillBoard", image: "images/billboard.png" },
    { name: "Rickshaws", image: "/assets/images/rickshaw.png" },
    { name: "Bus", image: "/assets/images/bus.png" },
    { name: "Roadside Walls", image: "/assets/images/roadsideWall.png" },
    { name: "Bus Shelter", image: "/assets/images/busShelter.png" },
  ];

  return (
    <div className="white-section">
      <h2 className="section-title">Browse Media by Genre</h2>
      <div className="genre-grid">
        {genres.map((genre, index) => (
          <div className="genre-card" key={index}>
            <img src={genre.image} alt={genre.name} />
            <p>{genre.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default GenreSection;
